template <typename MaybeConstUserType> struct Serializer<::blink::mojom::ElementDataView, MaybeConstUserType> {
    using UserType = typename std::remove_const<MaybeConstUserType>::type;
    using Traits = UnionTraits<::blink::mojom::ElementDataView, UserType>;

    static void Serialize(MaybeConstUserType& input, MessageFragment<::blink::mojom::internal::Element_Data>& fragment, bool inlined)
    {
        if (CallIsNullIfExists<Traits>(input)) {
            if (inlined)
                fragment->set_null();
            return;
        }

        if (!inlined)
            fragment.Allocate();

        // TODO(azani): Handle unknown and objects.
        // Set the not-null flag.
        fragment->size = kUnionDataSize;
        fragment->tag = Traits::GetTag(input);
        switch (fragment->tag) {
        case ::blink::mojom::ElementDataView::Tag::kBlobUuid: {
            decltype(Traits::blob_uuid(input)) in_blob_uuid = Traits::blob_uuid(input);
            mojo::internal::MessageFragment<typename decltype(fragment->data.f_blob_uuid)::BaseType> value_fragment(fragment.message());
            mojo::internal::Serialize<mojo::StringDataView>(in_blob_uuid, value_fragment);
            MOJO_INTERNAL_DLOG_SERIALIZATION_WARNING(
                value_fragment.is_null(), mojo::internal::VALIDATION_ERROR_UNEXPECTED_NULL_POINTER, "null blob_uuid in Element union");
            fragment->data.f_blob_uuid.Set(value_fragment.is_null() ? nullptr : value_fragment.data());
            break;
        }
        case ::blink::mojom::ElementDataView::Tag::kBytes: {
            decltype(Traits::bytes(input)) in_bytes = Traits::bytes(input);
            mojo::internal::MessageFragment<typename decltype(fragment->data.f_bytes)::BaseType> value_fragment(fragment.message());
            constexpr const mojo::internal::ContainerValidateParams& bytes_validate_params = mojo::internal::GetArrayValidator<0, false, nullptr>();
            mojo::internal::Serialize<mojo::ArrayDataView<uint8_t>>(in_bytes, value_fragment, &bytes_validate_params);
            MOJO_INTERNAL_DLOG_SERIALIZATION_WARNING(
                value_fragment.is_null(), mojo::internal::VALIDATION_ERROR_UNEXPECTED_NULL_POINTER, "null bytes in Element union");
            fragment->data.f_bytes.Set(value_fragment.is_null() ? nullptr : value_fragment.data());
            break;
        }
        case ::blink::mojom::ElementDataView::Tag::kFile: {
            decltype(Traits::file(input)) in_file = Traits::file(input);
            mojo::internal::MessageFragment<typename decltype(fragment->data.f_file)::BaseType> value_fragment(fragment.message());
            mojo::internal::Serialize<::blink::mojom::FileDataView>(in_file, value_fragment);
            MOJO_INTERNAL_DLOG_SERIALIZATION_WARNING(
                value_fragment.is_null(), mojo::internal::VALIDATION_ERROR_UNEXPECTED_NULL_POINTER, "null file in Element union");
            fragment->data.f_file.Set(value_fragment.is_null() ? nullptr : value_fragment.data());
            break;
        }
        case ::blink::mojom::ElementDataView::Tag::kDeprecatedFileSystemFile: {
            decltype(Traits::DEPRECATED_file_system_file(input)) in_DEPRECATED_file_system_file = Traits::DEPRECATED_file_system_file(input);
            mojo::internal::MessageFragment<typename decltype(fragment->data.f_DEPRECATED_file_system_file)::BaseType> value_fragment(fragment.message());
            mojo::internal::Serialize<::blink::mojom::DEPRECATED_FileSystemFileDataView>(in_DEPRECATED_file_system_file, value_fragment);
            MOJO_INTERNAL_DLOG_SERIALIZATION_WARNING(
                value_fragment.is_null(), mojo::internal::VALIDATION_ERROR_UNEXPECTED_NULL_POINTER, "null DEPRECATED_file_system_file in Element union");
            fragment->data.f_DEPRECATED_file_system_file.Set(value_fragment.is_null() ? nullptr : value_fragment.data());
            break;
        }
        }
    }

    static bool Deserialize(::blink::mojom::internal::Element_Data* input, UserType* output, Message* message)
    {
        if (!input || input->is_null())
            return CallSetToNullIfExists<Traits>(output);

        ::blink::mojom::ElementDataView data_view(input, message);
        return Traits::Read(data_view, output);
    }
};

